// import logo from './logo.svg';
import './App.css';
import Header from './Header';

import Footer from './Footer.js';

import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Shubh from './Shubh';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Routes>
          <Route path='/Shubh' element={<Shubh />} />
        </Routes>
        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
